import { Nav } from "./Nav"
import { Header } from "./Header"
import { Educationals } from "./Educationals"
import { PersonalInfo } from "./PersonalInfo"
// import { Contact } from "./Contact"
// import { Projects } from "./Projects"
// import { LandingPage } from "./LandingPage"
// import { Footer } from "./Footer"

import reactLogo from "./img/logo512.png"

function App() {

  const techDisplay = []

  class Tech {
    constructor(name, description, url, logo) {
        this.name = name,
        this.description = description,
        this.url = url,
        this.logo = logo
    }
  }

  const react = new Tech("React.js", "tech description", "", reactLogo)
  techDisplay.push(react)

  return ([
    <Nav />,
    <Header />,
    <PersonalInfo />,
    <Educationals tech={react}/>,
    /*
    <Contact />,
    <Projects />,
    <LandingPage />,
    <Footer />,*/
    ])
}

export { App }
